import React from "react";
import notes from "../notes.js";

const Note = () => {
  {
    notes.map((note) => {
      return (
        <div className="note">
          <h1>{note.title}</h1>
          <p>{note.content}</p>
        </div>
      );
    });
  }
};

export default Note;
